import React from "react";
import styled from "styled-components";
import MovieBox from "../components/MovieBox";

const Wrapper = styled.div`
  width: 100%;
  padding: 10px;

  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: center;

  flex-wrap: wrap;
`;

const MyApp = () => {
  return (
    <Wrapper>
      <MovieBox />
      <MovieBox />
      <MovieBox />
      <MovieBox />
    </Wrapper>
  );
};

export default MyApp;
